import React from "react";
const Card = ({ book }) => {
    console.log(book)
    return (
        <>
            {
                book.map((item) => {
                    return (
                        <div className="card">
                            <img src="./images/bg3.png" alt="" />
                            <div className="bottom">
                                <h3 className="title">React js</h3>
                                <p className="amount">&#8377; 3200</p>
                            </div>
                        </div>
                    )
                })
            }

        </>
    )
}
export default Card;
